import React from "react";
import HelloDiv from "./components/HelloDiv";
import { BrowserRouter as Router, Route } from "react-router-dom";
import Home from "./pages";

function App() {
  return (
    <Router>
      <Route exact path="/" component={Home} />
    </Router>
  );
}

export default App;
